-- ----------------------------
-- Table structure for ATTACHMENT
-- ----------------------------
DROP TABLE IF EXISTS `ATTACHMENT`;
CREATE TABLE `ATTACHMENT`  (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `IS_DELETE` tinyint(1) NULL DEFAULT NULL COMMENT '是否删除',
  `CREATED_AT` timestamp(3) NULL DEFAULT NULL,
  `UPDATED_AT` timestamp(3) NULL DEFAULT NULL COMMENT '修改时间',
  `STATUS` int(11) NULL DEFAULT 0 COMMENT '状态',
  `UUID` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT 'UUID',
  `ATTACHMENT_NAME` varchar(1536) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '附件名称',
  `FILE_NAME` varchar(1536) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '文件名称',
  `PATH` varchar(1536) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL,
  `TABLE_KEY` varchar(192) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '关联表',
  `KEY_ID` bigint(20) NOT NULL COMMENT '关联表的ID',
  `CREATOR` bigint(20) NOT NULL COMMENT '创建者',
  `UPDATER` bigint(20) NOT NULL COMMENT '更新者',
  `REMARK` varchar(1536) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '备注',
  `TAG` varchar(1536) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '标记',
  `CREATOR_TYPE` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT 'OPERATOR' COMMENT '用户类型, 默认为运营方',
  `BUCKET` varchar(512) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '存储bucket',
  `UNIQUE_KEY` varchar(512) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '存储bucket',
  PRIMARY KEY (`ID`) USING BTREE,
  INDEX `IDX_ATT_UUID`(`UUID`) USING BTREE,
  INDEX `IDX_ATT_TK`(`TABLE_KEY`, `KEY_ID`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 496 CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '附件' ROW_FORMAT = Dynamic;

