-- Table structure for CFCA_ACCOUNT
-- ----------------------------
DROP TABLE IF EXISTS `CFCA_ACCOUNT`;
CREATE TABLE `CFCA_ACCOUNT`  (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `IS_DELETE` tinyint(1) NULL DEFAULT 0 COMMENT '是否删除',
  `CREATED_AT` timestamp(3) NOT NULL COMMENT '创建时间',
  `UPDATED_AT` timestamp(3) NOT NULL COMMENT '修改时间',
  `STATUS` int(11) NULL DEFAULT 0 COMMENT '状态',
  `NAME` varchar(1536) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '名称, 公章为企业名称, 私章为个人名称',
  `ENTERPRISE_ID` bigint(20) NOT NULL COMMENT '企业ID',
  `LINK_ID` bigint(20) NOT NULL COMMENT '关联企业/联系人ID, 公章为企业ID, 私章为联系人ID',
  `USER_ID` varchar(512) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '安心签用户ID',
  `IDENT_TYPE_CODE` varchar(10) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '证件类型编码',
  `IDENT_NO` varchar(512) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '证件号码',
  `MOBILE_PHONE` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '电子签章的负责人或者经办人的手机号',
  `LANDLINE_PHONE` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '企业联系电话',
  `AUTHENTICATION_MODE` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '客户平台与安心签协议中，明确的认证方式，例如：线下人工审核；公安部数据联网核查；绑定银行卡实名认证；其他（说明方式）',
  `AN_XIN_SIGN_MOBILE_PHONE` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '如果用户三要素在安心签中已存在，该字段才会返回值，会隐藏中间几位',
  `AN_XIN_SIGN_EMAIL` varchar(512) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '如果用户三要素在安心签中已存在，该字段才会返回值，会隐藏中间几位',
  `EMAIL` varchar(512) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '邮箱',
  `TRANSACTOR_NAME` varchar(512) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '经办人名称',
  `TRANSACTOR_IDENT_TYPE_CODE` varchar(10) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '经办人证件类型编码',
  `TRANSACTOR_IDENT_NO` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '经办人证件号码',
  `TRANSACTOR_ADDRESS` varchar(4000) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '经办人地址',
  `ADDRESS` varchar(4000) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '地址, 私章时使用',
  `TYPE` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT 'ENTERPRISE' COMMENT '账户类型',
  `SEAL_ID` varchar(1536) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '印章ID',
  PRIMARY KEY (`ID`) USING BTREE,
  INDEX `IDX_CFCA_ACCOUNT_LID`(`LINK_ID`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 8 CHARACTER SET = utf8 COLLATE = utf8_bin COMMENT = '安心签账户' ROW_FORMAT = Dynamic;

